import './App.css';

import Tab from './Tabs';

function App() {
  const fags = { 'Why do dogs have wet noses?': 'Its ability to detect scents is up to 10,000 time more sensitive than the human nose. As an example, they can sniff out one rotten apple among 2 MILLION barrels of apples. A wet nose enhances the ability to trap olfactory chemicals in the secretions produced in the glands of the nose.',
                 'Why is my dog panting?' : 'Because they do not sweat like humans, excessive heat is lost as air moves through your dogs airways.',
                 'Why Do Dogs Wag Their Tails?': 'Dogs will wag their tail to convey a range of emotions: happiness, nervousness, feeling threatened, anxiety, submission and excitement.',
  }
  return (
    <div className="app">
      <tabs/>
    </div>
  );
}

export default App;
